cription","visibility":"ENGAGEMENT_PANEL_VISIBILITY_HIDDEN"}},"attributedDescription":{"content":"The official video for “Never Gonna Give You Up” by Rick Astley. \n\nNever: The Autobiography 📚 OUT NOW! \nFollow this link to get your copy and listen to Rick’s ‘Never’ playlist ❤️ #RickAstleyNever\nhttps://linktr.ee/rickastleynever\n\n“Never Gonna Give You Up” was a global smash on its release in July 1987, topping the charts in 25 countries including Rick’s native UK and the US Billboard Hot 100.  It also won the Brit Award for Best single in 1988. Stock Aitken and Waterman wrote and produced the track which was the lead-off single and lead track from Rick’s debut LP “Whenever You Need Somebody”.  The album was itself a UK number one and would go on to sell over 15 million copies worldwide.\n\nThe legendary video was directed by Simon West – who later went on to make Hollywood blockbusters such as Con Air, Lara Croft – Tomb Raider and The Expendables 2.  The video passed the 1bn YouTube views milestone on 28 July 2021.\n\nSubscribe to the official Rick Astley YouTube channel: https://RickAstley.lnk.to/YTSubID\n\nFollow Rick Astley:\nFacebook: https://RickAstley.lnk.to/FBFollowID \nTwitter: https://RickAstley.lnk.to/TwitterID \nInstagram: https://RickAstley.lnk.to/InstagramID \nWebsite: https://RickAstley.lnk.to/storeID \nTikTok: https://RickAstley.lnk.to/TikTokID\n\nListen to Rick Astley:\nSpotify: https://RickAstley.lnk.to/SpotifyID \nApple Music: https://RickAstley.lnk.to/AppleMusicID \nAmazon Music: https://RickAstley.lnk.to/AmazonMusicID \nDeezer: https://RickAstley.lnk.to/DeezerID \n\nLyrics:\nWe’re no strangers to love\nYou know the rules and so do I\nA full commitment’s what I’m thinking of\nYou wouldn’t get this from any other guy\n\nI just wanna tell you how I’m feeling\nGotta make you understand\n\nNever gonna give you up\nNever gonna let you down\nNever gonna run around and desert you\nNever gonna make you cry\nNever gonna say goodbye\nNever gonna tell a lie and hurt you\n\nWe’ve known each other for so long\nYour heart’s been aching but you’re too shy to say it\nInside we both know what’s been going on\nWe know the game and we’re gonna play it\n\nAnd if you ask me how I’m feeling\nDon’t tell me you’re too blind to see\n\nNever gonna give you up\nNever gonna let you down\nNever gonna run around and desert you\nNever gonna make you cry\nNever gonna say goodbye\nNever gonna tell a lie and hurt you\n\n#RickAstley #NeverGonnaGiveYouUp #WheneverYouNeedSomebody #OfficialMusicVideo","commandRuns":[{"startIndex":180,"length":16,"onTap":{"innertubeCommand":{"clickTrackingParams":"CJYEENzXBBggIhMI4OrOoPv5jQMVS7JLBR3jIx6K","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/rickastleynever","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUTCg9yaWNrYXN0bGV5bmV2ZXIYAQ%3D%3D"}}},"loggingDirectives":{"trackingParams":"CJYEENzXBBggIhMI4OrOoPv5jQMVS7JLBR3jIx6K"}},{"startIndex":197,"length":33,"onTap":{"innertubeCommand":{"clickTrackingParams":"CJEEEM2rARgBIhMI4OrOoPv5jQMVS7JLBR3jIx6KSMS7ga29mI6GdQ==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqa21XTXZXbGwyVHpGSVZZODBtNVlvb05fVm95UXxBQ3Jtc0ttcE5XOFMzX2dqaDhMZ3ItRXdPV00tY1kzbUQyVzJqVHJnUV9yWktNdHZjeHVKZy1UYjRGZXBCNjVoRXJfd1pRQ2VxbkpsMWF3TngzRmNhcWJweEEweFVCaV9JRHVIWTdhTGUzOGdsRTJ0NW91YXRfbw\u0026q=https%3A%2F%2Flinktr.ee%2Frickastleynever\u0026v=dQw4w9WgXcQ","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqa21XTXZXbGwyVHpGSVZZODBtNVlvb05fVm95UXxBQ3Jtc0ttcE5XOFMzX2dqaDhMZ3ItRXdPV00tY1kzbUQyVzJqVHJnUV9yWktNdHZjeHVKZy1UYjRGZXBCNjVoRXJfd1pRQ2VxbkpsMWF3TngzRmNhcWJweEEweFVCaV9JRHVIWTdhTGUzOGdsRTJ0NW91YXRfbw\u0026q=https%3A%2F%2Flinktr.ee%2Frickastleynever\u0026v=dQw4w9WgXcQ","target":"TARGET_NEW_WINDOW","no ext":{"content":"The official video for “Never Gonna Give You Up” by Rick Astley. \n\nNever: The Autobiography 📚 OUT NOW! \nFollow this link to get your copy and listen to Rick’s ‘Never’ playlist ❤️ #RickAstleyNever\nhttps://linktr.ee/rickastleynever\n\n“Never Gonna Give You Up” was a global smash on its release in July 1987, topping the charts in 25 countries including Rick’s native UK and the US Billboard Hot 100.  It also won the Brit Award for Best single in 1988. Stock Aitken and Waterman wrote and produced the track which was the lead-off single and lead track from Rick’s debut LP “Whenever You Need Somebody”.  The album was itself a UK number one and would go on to sell over 15 million copies worldwide.\n\nThe legendary video was directed by Simon West – who later went on to make Hollywood blockbusters such as Con Air, Lara Croft – Tomb Raider and The Expendables 2.  The video passed the 1bn YouTube views milestone on 28 July 2021.\n\nSubscribe to the official Rick Astley YouTube channel: https://RickAstley.lnk.to/YTSubID\n\nFollow Rick Astley:\nFacebook: https://RickAstley.lnk.to/FBFollowID \nTwitter: https://RickAstley.lnk.to/TwitterID \nInstagram: https://RickAstley.lnk.to/InstagramID \nWebsite: https://RickAstley.lnk.to/storeID \nTikTok: https://RickAstley.lnk.to/TikTokID\n\nListen to Rick Astley:\nSpotify: https://RickAstley.lnk.to/SpotifyID \nApple Music: https://RickAstley.lnk.to/AppleMusicID \nAmazon Music: https://RickAstley.lnk.to/AmazonMusicID \nDeezer: https://RickAstley.lnk.to/DeezerID \n\nLyrics:\nWe’re no strangers to love\nYou know the rules and so do I\nA full commitment’s what I’m thinking of\nYou wouldn’t get this from any other guy\n\nI just wanna tell you how I’m feeling\nGotta make you understand\n\nNever gonna give you up\nNever gonna let you down\nNever gonna run around and desert you\nNever gonna make you cry\nNever gonna say goodbye\nNever gonna tell a lie and hurt you\n\nWe’ve known each other for so long\nYour heart’s been aching but you’re too shy to say it\nInside we both know what’s been going on\nWe know the game and we’re gonna play it\n\nAnd if you ask me how I’m feeling\nDon’t tell me you’re too blind to see\n\nNever gonna give you up\nNever gonna let you down\nNever gonna run around and desert you\nNever gonna make you cry\nNever gonna say goodbye\nNever gonna tell a lie and hurt you\n\n#RickAstley #NeverGonnaGiveYouUp #WheneverYouNeedSomebody #OfficialMusicVideo","commandRuns":[{"startIndex":180,"length":16,"onTap":{"innertubeCommand":{"clickTrackingParams":"COABENzXBBgmIhMI4OrOoPv5jQMVS7JLBR3jIx6K","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/rickastleynever","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUTCg9yaWNrYXN0bGV5bmV2ZXIYAQ%3D%3D"}}},"loggingDirectives":{"trackingParams":"COABENzXBBgmIhMI4OrOoPv5jQMVS7JLBR3jIx6K"}},{"startIndex":197,"length":33,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBQQ040EGAUiEwjg6s6g-_mNAxVLsksFHeMjHopIxLuBrb2YjoZ1","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbmRHcUw2MzZHOHU2Z2d2WDBxTTlnWTNEVERwd3xBQ3Jtc0ttM2FscHpXTFFvWDFnclVwYXlNWkFveHFvSWotWFBXejRoYmg0X1d6dXZraFdLU21vQjVKMWg0ZWwtUEJhbzRXS0dSWkhHTEJfblY5V25rdzBEQVhWemYySmJOcnFINHU3TVp5TnowSG5fc1Y4S1JVRQ\u0026q=https%3A%2F%2Flinktr.ee%2Frickastleynever\u0026v=dQw4w9WgXcQ","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbmRHcUw2MzZHOHU2Z2d2WDBxTTlnWTNEVERwd3xBQ3Jtc0ttM2FscHpXTFFvWDFnclVwYXlNWkFveHFvSWotWFBXejRoYmg0X1d6dXZraFdLU21vQjVKMWg0ZWwtUEJhbzRXS0dSWkhHTEJfblY5V25rdzBEQVhWemYySmJOcnFINHU3TVp5TnowSG5fc1Y4S1JVRQ\u0026q=https%3A%2F%2Flinktr.ee%2Frickastleynever\u0026v=dQw4w9WgXcQ","target":"TARGET_NEW_WINDOW","nofollow":true}}}},{"startIndex":985,"length":33,"onTap":{"innertubeCommand":{"clickTra
